 </table> <p><b>Slick</b> may refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Places"><span class="tocnumber">1</span> <span class="toctext">Places</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#People"><span class="tocnumber">2</span> <span class="toctext">People</span></a> <ul> <li class="toclevel-2 tocsection-3"><a href="#Musicians"><span class="tocnumber">2.1</span> <span class="toctext">Musicians</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-4"><a href="#Arts,_entertainment,_and_media"><span class="tocnumber">3</span> <span class="toctext">Arts, entertainment, and media</span></a> <ul> <li class="toclevel-2 tocsection-5"><a href="#Fictional_characters"><span class="tocnumber">3.1</span> <span class="toctext">Fictional characters</span></a></li> <li class="toclevel-2 tocsection-6"><a href="#Other_arts,_entertainment,_and_media"><span class="tocnumber">3.2</span> <span class="toctext">Other arts, entertainment, and media</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-7"><a href="#Transportation"><span class="tocnumber">4</span> <span class="toctext">Transportation</span></a></li> <li class="toclevel-1 tocsection-8"><a href="#Other_uses"><span class="tocnumber">5</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-9"><a href="#See_also"><span class="tocnumber">6</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=1" title="Edit section: Places">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Slick,_Oklahoma" title="Slick, Oklahoma">Slick, Oklahoma</a>, a US town</li> </ul> <h2><span class="mw-headline" id="People">People</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=2" title="Edit section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Slick_(nickname)" title="Slick (nickname)">Slick (nickname)</a></li> <li><a href="/wiki/Slick_(surname)" title="Slick (surname)">Slick (surname)</a></li> <li><a href="/wiki/Slick_(wrestling)" title="Slick (wrestling)">Slick (wrestling)</a>, ring name of former professional wrestling manager Ken Johnson (born 1957)</li> </ul> <h3><span class="mw-headline" id="Musicians">Musicians</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=3" title="Edit section: Musicians">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Slick_Aguilar" title="Slick Aguilar">Slick Aguilar</a> (born 1954), American guitarist</li> <li><a href="/wiki/Ricky_Bell_(singer)" title="Ricky Bell (singer)">Ricky Bell (singer)</a> (born 1967), a.k.a. Slick, R&amp;B singer for New Edition &amp; Bell Biv DeVoe</li> <li><a href="/wiki/Slick_Rick" title="Slick Rick">Slick Rick</a> (born 1965), rapper</li> <li><a href="/wiki/Darby_Slick" title="Darby Slick">Darby Slick</a></li> <li><a href="/wiki/Earl_Slick" title="Earl Slick">Earl Slick</a> (born 1952), American rock guitarist</li> <li>Eric Slick, member of <a href="/wiki/Adrian_Belew_Power_Trio" title="Adrian Belew Power Trio">Adrian Belew Power Trio</a></li> <li><a href="/wiki/Grace_Slick" title="Grace Slick">Grace Slick</a> (born 1939), singer</li> <li>Julie Slick, member of <a href="/wiki/Adrian_Belew_Power_Trio" title="Adrian Belew Power Trio">Adrian Belew Power Trio</a></li> <li><a href="/wiki/Mitchy_Slick" title="Mitchy Slick">Mitchy Slick</a> (born 1978), rapper</li> <li><a href="/wiki/Sgt_Slick" title="Sgt Slick">Sgt Slick</a>, DJ in Melbourne, Australia, also known as Andy J</li> </ul> <h2><span id="Arts.2C_entertainment.2C_and_media"></span><span class="mw-headline" id="Arts,_entertainment,_and_media">Arts, entertainment, and media</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=4" title="Edit section: Arts, entertainment, and media">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <h3><span class="mw-headline" id="Fictional_characters">Fictional characters</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=5" title="Edit section: Fictional characters">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Slick_(comics)" class="mw-redirect" title="Slick (comics)">Slick (comics)</a>, two different characters in the Marvel Universe</li> <li>Slick, the final boss in the video game <i><a href="/wiki/River_City_Ransom" title="River City Ransom">River City Ransom</a></i></li> <li>Slick, one of the main characters in the webcomic <i><a href="/wiki/Sinfest" title="Sinfest">Sinfest</a></i></li> <li><a href="/wiki/Sam_Slick" title="Sam Slick">Sam Slick</a>, a character created by Thomas Chandler Haliburton, a Canadian judge and author</li> <li><a href="/wiki/Soapy_Slick" class="mw-redirect" title="Soapy Slick">Soapy Slick</a>, saloon operator and profiteer in the <i>Scrooge McDuck</i> comic series</li> <li>Tom Slick, the title character of the TV series <i><a href="/wiki/Tom_Slick_(TV_series)" title="Tom Slick (TV series)">Tom Slick</a></i></li> </ul> <h3><span id="Other_arts.2C_entertainment.2C_and_media"></span><span class="mw-headline" id="Other_arts,_entertainment,_and_media">Other arts, entertainment, and media</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=6" title="Edit section: Other arts, entertainment, and media">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Slick_(album)" title="Slick (album)"><i>Slick</i> (album)</a>, a 1977 album by Eddie Kendricks</li> <li><a href="/wiki/Slick_(magazine_format)" title="Slick (magazine format)">Slick (magazine format)</a>, an upmarket format for magazines indicating they were printed on high quality paper</li> <li>"Slick", the second episode of the TV series <i><a href="/wiki/Birds_of_Prey_(TV_series)" title="Birds of Prey (TV series)">Birds of Prey</a></i></li> </ul> <h2><span class="mw-headline" id="Transportation">Transportation</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=7" title="Edit section: Transportation">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Bell_UH-1_Iroquois" title="Bell UH-1 Iroquois">Bell UH-1 Iroquois</a>, a military helicopter nicknamed Slick</li> <li><a href="/wiki/Slick_Airways" title="Slick Airways">Slick Airways</a>, an American charter and scheduled freight airline</li> <li><a href="/wiki/Slick_tire" class="mw-redirect" title="Slick tire">Slick tire</a>, used in motor racing</li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Slick&amp;action=edit&amp;section=8" title="Edit section: Other uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Slick_(tool)" title="Slick (tool)">Slick (tool)</a>, a large woodworking chisel</li> <li><a href="/wiki/KCNT2" title="KCNT2">KCNT2</a> (symbol SLICK), a human gene</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a h